import axios from "axios";
import CONSTANTS from "./constants";

export function fetchApi(endPoint: RequestInfo, options: RequestInit): any {
    return new Promise(async(resolve, reject) => {
        const req = await axios.get(`${CONSTANTS.URL}?${endPoint}`)
        resolve(req)

        reject([])


    })
}
